  const [data, setData] = useState(null);
  const [value, setValue] = useState('');

  var ref = useRef(null);
  //const myElement = useRef(null);
  const handleChange = (event) => {
    setValue(event.target.value);
  };
  useEffect(() => {
    let elementStart = document.getElementById('start');
    let elementEnd = document.getElementById('end');
    //console.log(elementStart);
    if (elementStart) {
    console.log(elementStart['id']);
    }
    if (elementEnd) {
      console.log(elementEnd['id']);
    }
    
    async function fetchData() {
      const response = await fetch("http://127.0.0.1:5000/hello");
      const json = await response.json();
      setData(json);
    }
    fetchData();
  }, []);

  return (
    <div>
        <div id="map"></div>
    <label htmlFor="start">Start: </label>
    <input type="text" id="start" value="Chicago, IL" ref={ref} onChange={handleChange}/>
    <br/>
    <label htmlFor="end">End: </label>
    <input type="text" id="end" value="Los Angeles, CA" ref={ref}/>
    <br/>
    <button id="submitBtn">Submit</button>

      {data ? <div>{JSON.stringify(data)}</div> : <div>Loading...</div>}
    </div>
  );
};

export default HomePage;
